import gmpy2
from gmpy2 import mpz, isqrt
n = mpz('')
r = isqrt(n)

i = 0
while True:
    a = r + i
    if pow(a, 2) > n:
        x = isqrt(pow(a, 2) - n)
        if (a - x) * (a + x) == n: 
            p = a - x
            q = a + x
            break
    i = i + 1

print("P: \n{}".format(a-x))
print("Q: \n{}".format(a+x))

